import React from 'react';

const MediaDisplay = (props) => {
    console.log("here")
    if (props.type === 'image') {
        return <img src={props.src} alt={props.alt} width="100px" />;
    } else if (props.type === 'video') {
        return <video src={props.src} controls />;
    }
};

export default MediaDisplay;
